import React, { Component } from 'react';

class SearchBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="search-bar ui segment">
        <form className="ui form">
          <div className="field">
            <label>
              Video Search:
              <input type="text" />
            </label>
          </div>
        </form>
      </div>
    );
  }
}

export default SearchBar;
